public final boolean equals(final Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }

  TaskId other = (TaskId) obj;
  if (jobId == null) {
    if (other.jobId != null) {
      return false;
    }
  } else if (!jobId.equals(other.jobId)) {
    return false;
  }
  if (taskId != other.taskId) {
    return false;
  }
  return true;
}
